var urlpronta="http://paulorobertoelias.com.br/api/api/livros/getall";$.get(urlpronta,function(t){$("#div_loading").css("display","none");var l=[];$.each(t,function(a){l.push("<a href='#' data-toggle='tooltip' title='"+t[a].Title+"'><img src='"+t[a].ImageUrl+"'.jpg' class='estante'></a>")}),$("#resultado").empty(),$("<div/>",{class:"",html:l.join("")}).appendTo("#resultado")});